import React from "react";
import { Link } from 'react-router-dom'; // Importe o Link do React Router

function Navbar() {
  return (
    <div className="navbar navbar-expand-lg fixed-top navbar-dark bg-primary">
      <div className="container">
        <Link to="/" className="navbar-brand">Minhas Finanças</Link> {/* Use o Link para "Home" */}
        <button className="navbar-toggler" type="button" 
                data-toggle="collapse" data-target="#navbarResponsive" 
                aria-controls="navbarResponsive" aria-expanded="false" 
                aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarResponsive">
          <ul className="navbar-nav">
            <li className="nav-item">
              <Link to="/" className="nav-link">Home</Link> {/* Use o Link para "Home" */}
            </li>
            <li className="nav-item">
              <Link to="/cadastro-usuarios" className="nav-link">Usuários</Link> {/* Use o Link para "Usuários" */}
            </li>
            <li className="nav-item">
              <Link to="/" className="nav-link">Lançamentos</Link> {/* Use o Link para "Lançamentos" */}
            </li>
            <li className="nav-item">
              <Link to="/login" className="nav-link">Login</Link> {/* Use o Link para "Login" */}
            </li>
          </ul>
        </div>
      </div>
    </div>
  );
}

export default Navbar;
